        "contentPlainText": "模板引擎 前端模板引擎主要用来降低视图与数据的耦合性，提高视图结构的重用性。MWF框架模板引擎涉及的脚本文件包括： ? util/template/jst.js ? util/template/ntp.js ? util/template/tpl.js 可选脚本包括(如果使用扩展类型模板则需要加以下脚本)： ? util/ajax/loader/loader.js ? util/ajax/loader/loader.style.js ? util/ajax/loader/loader.script.js ? util/ajax/loader/loader.html.js ? util/ajax/tag.js 模板类型 框架提供的模板类型分为基本类型和扩展类型，其中扩展类型主要用来载入外联资源，并将其应用到系统中。 基本类型包括以下三种： ? jst模板 ? text模板 ? node模板 扩展类型包括以下三种： ? css模板 ? html模板 ? javascript模板 JST模板 符合模板语法规范的不包含数据的HTML结构的模板，模板初始化时作为字符串缓存，首次使用时转为JS函数，后续缓存该函数直接调用。 TEXT模板 纯文本类模板，一般用于动态生成不涉及数据的HTML结构的模板，模板初始时作为字符串缓存，使用时直接取字符串。 NODE模板 不带数据的HTML结构模板，模板初始化时作为字符串缓存，首次使用时转为DOM树结构，后续使用结构克隆方式生成DOM树结构。 CSS模板 动态载入样式文件或者动态生效内联样式，此模板一般用于一些不是首次显示的模块或者动态载入的模块的样式，当模块被请求显示时再动态生效这些样式。 HTML模板 动态载入模板集合，载入的html文件仅包含若干规范中定义类型的模板，用来做嵌套模板，此模板一般用于一些不是首次显示的模块或者动态载入的模块的模板集合，当模块被请求显示时再动态解析里面的模板。 JAVASCRIPT模板 动态载入脚本文件或者动态生效内联脚本，此模板一般用于一些不是首次显示的模块或者动态载入的模块的逻辑，当模块被请求显示时再动态生效的脚本。 模板载入 模板统一在页面的TEXTAREA中载入，所有模板均放在一隐藏的DIV结构下，对于HTML模板中的模板集合统一放在document.body下 模板结构 模板内容均放在TEXTAREA下，并使用TEXTAREA的name来标识类型。 注：模板内容中的/textarea用#47;textarea 大致结构如下图所示： ? 基本类型模板： 必须使用id来标识模板，后续根据该值从缓存中取模板实体 ? 扩展类型模板： 必须使用data-src指定资源路径，多个路径用逗号分隔，html模板不支持多路径 可选使用data-version指定资源版本号，多个路径均使用此版本请求资源 JST模板 TEMPLATE_TYPE : jst TEXT模板 TEMPLATE_TYPE : txt NODE模板 TEMPLATE_TYPE : ntp CSS模板 TEMPLATE_TYPE : css css的加载顺序同data-src中定义的路径的顺序，最后内联内容里的样式，如上具体生成如下图所示 HTML模板 TEMPLATE_TYPE : html 载入的html必须与主页面同域，载入完成后只解析body下的textarea模板 JAVASCRIPT模板 TEMPLATE_TYPE : js javascript并行载入，按照data-src指定的顺序执行，所有data-src中的脚本执行完成后执行内容里的脚本 模板初始化 系统初始化时需将页面上的模板进行统一解析，使用MWF框架的mwf.e._$parseTemplate接口输入模板集合标识(TEMPLATE_ID)进行解析处理，后续逻辑可以根据各类型模板的相应接口取出对应的模板 模板使用 TEXT模板 使用以下接口取出该类模板 _$getTextTemplate 类型 描述 输入 String 模板键 输出 String 文本模板内容 描述 获取通过_$addTextTemplate缓存的模板 应用举例 JST模板 使用以下接口取出该类模板 _$getHtmlTemplate 类型 描述 输入 String 模板键 Object 数据集 Object 扩展接口 输出 String 模板对象 描述 获取通过_$addHtmlTemplate缓存的模板 应用举例 NODE模板 使用以下接口取出该类模板 _$getNodeTemplate 类型 描述 输入 String 模板键 输出 Node 节点模板对象 描述 获取通过_$addNodeTemplate缓存的模板 应用举例 ",
