        "contentPlainText": "结构 整套模型由以下几部分组成 ? 管理器：管理系统所有模块的调度 ? 配置器：管理器中每个模块相关的配置信息 ? 验证器：每个模块在调度之前对输入数据进行验证的处理 ? 模　块：模块具体行为的封装 各组成部分的相互关系如下图所示 管理器 管理器主要负责根据需求调度不同模块，这部分主要涉及两个主要流程 ? 配置器注册流程：管理器初始化时自动处理或者具体逻辑中动态注册 ? 模块调度流程：对于检测Hash的管理器可自动调度模块 配置器注册流程 模块调度流程 配置器 配置器主要负责获取验证器和模块实例，如果后续实践需对此模型进行扩展可通过增强此配置器来实现。这部分主要涉及两个功能 ? 取验证器实例 ? 取模块实例 验证器 验证器主要负责对调度输入信息的验证，如验证成功则通过将控制权转交管理器继续后续模块调度逻辑，否则重定向至其他模块。具体模块的验证逻辑由各具体应用实现。 模块 模块主要负责实现具体业务逻辑，根据具体应用实现即可。 实现 模型实现的类图结构如下图所示 _$$Manager 管理器的实现类，可用于顶层模块管理器也可用于级联模块管理器 __query2obj 类型 描述 输入 String 查询串，如 a=aaab=bbbc=ccc 输出 Object 数据对象，如{a:’aaa’,b:’bbb’,c:’ccc’} 描述 将查询串转成数据对象 _$dispatch 类型 描述 输入 Object 调度信息 输出 Void 无 描述 根据调度信息调度指定模块 _$redirect 类型 描述 输入 String 查询串 输出 Void 无 描述 重定向模块 _$regist 类型 描述 输入 String 模块键值 _$$Configuration 配置对象 输出 Void 无 描述 注册模块配置对象 _$query 类型 描述 输入 Void 无 输出 String 当前模块的查询串 描述 取当前模块的查询串 _$hide 类型 描述 输入 Void 无 输出 Void 无 描述 隐藏当期模块 _$$HashManager 监测Hash变化的管理器实现类，一般用于顶层模块管理器 __query2obj 见_$$Manager的__query2obj接口 __needHistory 类型 描述 输入 String 模块查询串 输出 Boolean 是否将查询串推入历史管理 描述 判断指定模块查询串是否进入历史管理队列 _$dispatch 见_$$Manager的_$dispatch接口 _$redirect 类型 描述 输入 String 查询串 Boolean 是否需要加入历史队列 输出 Void 无 描述 重定向模块 _$regist 见_$$Manager的_$regist接口 _$query 见_$$Manager的_$query接口 _$hide 见_$$Manager的_$hide接口 _$back 类型 描述 输入 Void 无 输出 Void 无 描述 后退模块 _$$Configuration 配置器实现类 __getModule 类型 描述 输入 Void 无 输出 _$$Module 模块实例 描述 取模块实例，新创建实例，由子类实现具体逻辑 __getValidator 类型 描述 输入 Void 无 输出 _$$Validator 验证器实例 描述 取验证器实例，新创建实例，由子类实现具体逻辑 _$getModule 类型 描述 输入 Void 无 输出 _$$Module 模块实例 描述 取模块实例，由管理器调用，控制模块实例只创建一次 _$getValidator 类型 描述 输入 Void 无 输出 _$$Validator 验证器实例 描述 取验证器实例，由管理器调用，控制模块实例只创建一次 _$$Validator 验证器实现类 _$validate 类型 描述 输入 Object 输入信息对象 输出 Void 无 描述 验证输入信息，通过验证做onpass回调，否则做onredirect回调 _$$Module 模块基类实现类 __buildModule 类型 描述 输入 Object 可选配置参数 输出 Void 无 描述 构建模块 __onBeforeShow 类型 描述 输入 Void 无 输出 Void 无 描述 模块显示前处理逻辑，子类按需实现具体逻辑 __onBeforeHide 类型 描述 输入 Void 无 输出 Void 无 描述 模块隐藏前处理逻辑，子类按需实现具体逻辑 __onAfterShow 类型 描述 输入 Void 无 输出 Void 无 描述 模块显示后处理逻辑，子类按需实现具体逻辑 __onAfterHide 类型 描述 输入 Void 无 输出 Void 无 描述 模块隐藏后处理逻辑，子类按需实现具体逻辑 _$show 类型 描述 输入 Object 用户输入信息 输出 Void 无 描述 显示模块逻辑 _$hide 类型 描述 输入 Void 无 输出 Void 无 描述 隐藏模块逻辑 _$query 类型 描述 输入 Void 无 输出 String 模块查询串 描述 取模块查询串 _$$ModuleCP 层级模块基类实现类 __buildModule 见_$$Module的__buildModule接口 __onBeforeShow 见_$$Module的__onBeforeShow接口 __onBeforeHide 见_$$Module的__onBeforeHide接口 __onAfterShow 见_$$Module的__onAfterShow接口 __onAfterHide 见_$$Module的__onAfterHide接口 _$show 见_$$Module的_$show接口 _$hide 见_$$Module的_$hide接口 _$query 见_$$Module的_$query接口 应用 单层级多模块调度系统 效果 说明： ? 左侧模块切换导航 ? 右侧显示模块内容，不同模块用颜色标识 ? 使用浏览器HASH来标识模块 实现 视图相关 样式 结构 模块I实现 模块II实现 模块III实现 系统入口 多层级多模块调度系统 效果 说明： ? 左侧一级模块切换导航 ? 右侧二级模块切换导航及显示模块内容，不同模块用颜色标识 ? 使用浏览器HASH来标识模块 ? 具体模块实现逻辑同单层级模块 实现 视图相关 样式 结构 一级模块I 一级模块II 一级模块III 系统入口 ",
