        "blogAbstract": " <br><b><font size=\"5\">一、概述</font></b><br><br>\n\n<p style=\"text-indent: 2em;\">CMT模型（Cache-Module-Template）是MVC框架在WEB前端的一个具体应用。</p>\n\n<ul><li>Cache(数据)层：主要负责处理数据相关的逻辑，包括本地数据缓存的管理、与远程数据的交互等等</li><li>Module(模块)层：主要负责处理业务逻辑，将各控件各层级模块有机的整合在一起实现完整的功能逻辑等等</li><li>Template(模板)层：主要负责系统展示效果，实现系统的结构和表现，也是用户可以直接与系统交互的主要接口</li></ul>\n\n\n\n\n\n<br><b><font size=\"5\">二、特点</font></b><br><br>1.&nbsp;&nbsp; 高重用性<br>\n\n",
