        "blogAbstract": "<p style=\"text-indent: 2em;\"><font size=\"3\">随着前端异步载入数据相关技术的不断普及，时常会出现一类应用场景：异步载入数据后前端使用模板生成相关的html代码，然后用innerHTML塞到页面某个节点。本文主要比较<font color=\"#0000ff\"><b>IE6</b></font>下在这类场景中用img和background引入<font color=\"#0000ff\"><b>同一张图片</b></font>（比较常见的就是用户的头像）方式的差异，当然选用img还是background引入图片需要考虑的其他因素很多这里不做另外详述。</font></p><p style=\"text-indent: 2em;\"><font size=\"3\">测试代码：在一个id为abc的节点分别用img和background的方式塞入20张相同图片</font></p>",
