        "content": "<p style=\"text-indent: 2em;\"><font size=\"3\">随着前端异步载入数据相关技术的不断普及，时常会出现一类应用场景：异步载入数据后前端使用模板生成相关的html代码，然后用innerHTML塞到页面某个节点。本文主要比较<font color=\"#0000ff\"><b>IE6</b></font>下在这类场景中用img和background引入<font color=\"#0000ff\"><b>同一张图片</b></font>（比较常见的就是用户的头像）方式的差异，当然选用img还是background引入图片需要考虑的其他因素很多这里不做另外详述。</font></p><p style=\"text-indent: 2em;\"><font size=\"3\">测试代码：在一个id为abc的节点分别用img和background的方式塞入20张相同图片</font></p><blockquote><div><img title=\"【IE6】image vs background - genify - ajaxer\" alt=\"【IE6】image vs background - genify - ajaxer\" style=\"margin: 0pt 10px 0pt 0pt;\" src=\"http://img762.ph.126.net/LdesYPNIoMO8uLSJBJUzHQ==/1233986297900403840.png\"></div></blockquote><ul><li><font size=\"3\">&nbsp;</font><font size=\"3\">image方式</font></li></ul><blockquote><font size=\"3\">同一张图片总共发出了20个图片请求</font><br><div><img title=\"【IE6】image vs background - genify - ajaxer\" alt=\"【IE6】image vs background - genify - ajaxer\" style=\"margin: 0pt 10px 0pt 0pt;\" src=\"http://img116.ph.126.net/Uo1necMU2J1CrvG6yWIc8w==/710161366242578128.png\"></div></blockquote><ul><li><font size=\"3\">background方式 </font></li></ul><blockquote><font size=\"3\">同一张图片总共发出1个图片请求</font></blockquote><blockquote><div><img title=\"【IE6】image vs background - genify - ajaxer\" alt=\"【IE6】image vs background - genify - ajaxer\" style=\"margin: 0pt 10px 0pt 0pt;\" src=\"http://img237.ph.126.net/zxvKnPyAn5FBqyTjH6dewg==/1757529754582794364.png\"></div></blockquote>\n<blockquote>\n  </blockquote><blockquote>\n</blockquote><blockquote><font color=\"#ff0000\" size=\"3\">注：在没有开启BackgroundImageCache的\n情况下同image方式也有20个请求</font><br><font size=\"3\">\n  </font></blockquote>",
