        "content": "<b><font color=\"#0000ff\">症状：</font></b>opera下用innerHTML设置的空格如果是&amp;nbsp;的情况下，把innerHTML的内容拷贝出来在其他文本编辑器中显示时这些空格都会变成问号（即很多在线html编辑器(如webmail写的邮件,博客的日志编辑器等等)常碰到的空格莫名其妙的变成问号的问题）。<br><font color=\"#0000ff\"><b>原因：</b></font>opera下获取的innerHTML中&amp;nbsp;用的是NO-BREAK SPACE字符而不是用实体代码&amp;nbsp; 虽然这两个是同一个东西，但是前面那个字符容易出现编码问题，如果我取出来的内容刚好粘贴到不支持该字符的编辑器中或者数据提交到服务器编码没编号就会显示成问号。关于NO-BREAK SPACE字符的详细信息如下：<br><div><img title=\"【OP】innerHTML中的nbsp; - genify - ajaxer\" alt=\"【OP】innerHTML中的nbsp; - genify - ajaxer\" style=\"margin: 0pt 10px 0pt 0pt;\" src=\"http://img.ph.126.net/I09SKZHkLyyPg9GDc8wTqQ==/3263702354961179698.png\"></div><font color=\"#0000ff\"><b>解决方案：</b></font>将所有NO-BREAK SPACE字符替换成&amp;nbsp;后再做进一步处理<br><font color=\"#0000ff\"><b>测试用例：</b></font><br>用例代码如下<br><div><div><img title=\"【OP】innerHTML中的nbsp; - genify - ajaxer\" alt=\"【OP】innerHTML中的nbsp; - genify - ajaxer\" style=\"margin: 0pt 10px 0pt 0pt;\" src=\"http://img.ph.126.net/CNJZYdIHwxbu-OOfjwl_cw==/3328723074580389164.png\"></div></div>测试各浏览器下innerHTML中对空格和&amp;nbsp;的处理<br><div><div><div><img title=\"【OP】innerHTML中的nbsp; - genify - ajaxer\" alt=\"【OP】innerHTML中的nbsp; - genify - ajaxer\" style=\"margin: 0pt 10px 0pt 0pt;\" src=\"http://img313.ph.126.net/GI_AxrgMRU8svUCuy7aWUA==/3665648621703012534.png\"></div>通过对比可以看出各浏览器对&amp;nbsp;的处理情况，将opera下的160字符替换成&amp;nbsp;可以达到各浏览器下统一，也不知道opera是出于什么考虑这里要搞个特殊化，代码替换如下<br></div></div><div><div><div><img title=\"【OP】innerHTML中的nbsp; - genify - ajaxer\" alt=\"【OP】innerHTML中的nbsp; - genify - ajaxer\" style=\"margin: 0pt 10px 0pt 0pt;\" src=\"http://img313.ph.126.net/BHE8qoUYAu6qOEvw9-uQxQ==/3681411220398809367.png\"><br><br></div></div></div>",
