        "commentCount": 5,
        "comments": null,
        "content": "<span style=\"color: rgb(0, 0, 255);\"><span style=\"font-weight: bold;\">症状：</span><span style=\"color: rgb(0, 0, 0);\">使用JavaS<wbr>cript动态生成IFrame，刷新页面时随机生成IFrame的请求地址，理论上每次使用不同地址时IFrame应该都会请求新的页面，但是在Firefox下刷新页面后不管IFrame的地址怎么变化浏览器发出的请求始终是最后一次正确访问的页面。<br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">原因：</span>初步认定为Firefox的缓存机制导致但又不完全是，确切原因有待进一步查证。<br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">解决方案：</span><span style=\"color: rgb(0, 0, 0);\">一个不是很完美的解决方案就是在IFrame添加到页面后重置IFrame的SRC来Abort前面缓存的请求从而刷新IFrame里面的内容。如果使用createElement方式创建的iframe节点务必保证先append到页面上再设置SRC地址，否则仍然会存在这个问题。继续寻求更完善的解决方案。</span><br><span style=\"font-weight: bold; color: rgb(51, 102, 255);\">测试用例：</span><br>测试代码目的为每次都用一个随机的域访问页面<br></span></span><a href=\"http://img154.ph.126.net/T6Wo7eC-bqy3axX_RJhoRA==/1487313776940628971.bmp\" target=\"_blank\"><img title=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" alt=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" src=\"http://img154.ph.126.net/T6Wo7eC-bqy3axX_RJhoRA==/1487313776940628971.bmp\"></a><br>第一次IFrame可访问正常页面，即浏览器发出的请求与预设的地址一致<br><a href=\"http://img58.ph.126.net/q4jVtY0RE0QRIS0qRZWp9w==/1834090948248030937.bmp\" target=\"_blank\"><img title=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" alt=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" src=\"http://img58.ph.126.net/q4jVtY0RE0QRIS0qRZWp9w==/1834090948248030937.bmp\"></a><br>使用F5或者浏览器刷新功能刷新页面，浏览器发出的请求与实际设置的地址并不一致，这个就是问题所在<br><a href=\"http://img157.ph.126.net/JOtd6ibqpMDMJJCLkDJQ3g==/1475491827918635175.bmp\" target=\"_blank\"><img title=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" alt=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" src=\"http://img157.ph.126.net/JOtd6ibqpMDMJJCLkDJQ3g==/1475491827918635175.bmp\"></a><br>使用CTRL+F5刷新页面即可正常访问页面<br><a href=\"http://img157.ph.126.net/kZPzeLgfRc_NBShUMcamLA==/1475491827918635179.bmp\" target=\"_blank\"><img title=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" alt=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" src=\"http://img157.ph.126.net/kZPzeLgfRc_NBShUMcamLA==/1475491827918635179.bmp\"></a><br>初步怀疑Firefox的缓存原因，但是仔细想想也不太对，新设置的地址连域都发生变化了没理由再从缓存里取内容Y。<br>修改代码使用重置src来刷新iframe<br><a href=\"http://img245.ph.126.net/vJrEV5m7J55ajX2lpOrQlQ==/2107966100587293300.bmp\" target=\"_blank\"><img title=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" alt=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" src=\"http://img245.ph.126.net/vJrEV5m7J55ajX2lpOrQlQ==/2107966100587293300.bmp\"></a><br>新的方式虽然可以解决请求不一致的问题，但是却多了一个被abort的请求，继续寻求更好的解决方案<br><a href=\"http://img245.ph.126.net/X7IOApvRPwaf_0e6snbPfw==/1383449510534222740.bmp\" target=\"_blank\"><img title=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" alt=\"【FF】Firefox缓存了IFrame的内容？ - genify - ajaxer\" src=\"http://img245.ph.126.net/X7IOApvRPwaf_0e6snbPfw==/1383449510534222740.bmp\"></a><br><br><br><font style=\"font-weight: bold;\" size=\"4\"><span style=\"color: rgb(255, 0, 0);\">好像IE也有这个问题。。。。</span></font>",
        "contentPlainText": "症状：使用JavaScript动态生成IFrame，刷新页面时随机生成IFrame的请求地址，理论上每次使用不同地址时IFrame应该都会请求新的页面，但是在Firefox下刷新页面后不管IFrame的地址怎么变化浏览器发出的请求始终是最后一次正确访问的页面。原因：初步认定为Firefox的缓存机制导致但又不完全是，确切原因有待进一步查证。解决方案：一个不是很完美的解决方案就是在IFrame添加到页面后重置IFrame的SRC来Abort前面缓存的请求从而刷新IFrame里面的内容。如果使用createElement方式创建的iframe节点务必保证先append到页面上再设置SRC地址，否则仍然会存在这个问题。继续寻求更完善的解决方案。测试用例：测试代码目的为每次都用一个随机的域访问页面第一次IFrame可访问正常页面，即浏览器发出的请求与预设的地址一致使用F5或者浏览器刷新功能刷新页面，浏览器发出的请求与实际设置的地址并不一致，这个就是问题所在使用CTRL+F5刷新页面即可正常访问页面初步怀疑Firefox的缓存原因，但是仔细想想也不太对，新设置的地址连域都发生变化了没理由再从缓存里取内容Y。修改代码使用重置src来刷新iframe新的方式虽然可以解决请求不一致的问题，但是却多了一个被abort的请求，继续寻求更好的解决方案好像IE也有这个问题。。。。",
