        "content": "NTS框架中采用了新的方式记录浏览器的操作历史，因此在某些带IFRAME载入内容的项目中不希望这个IFRAME的变化影响到整个系统的操作历史，下面给出两种禁止IFRAME记录操作历史的解决方案，各有利弊视具体情况选取。<br><font style=\"font-weight: bold;\"  size=\"4\"  >方案一</font><br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\"  >原理：</span>利用location的replace方法载入新页面，关于replace方法的描述：<br> <div style=\"margin-left: 40px;\"  >When a document is replaced, it is also removed from the <a rel=\"nofollow\" href=\"/objects/obj_history.html\"  >history</a> object. Moreover, the user interface navigation methods, such as the Back and Forward buttons, will no longer access the URL.<br> </div> <span style=\"font-weight: bold; color: rgb(0, 0, 255);\"  >分析：</span>此方案有个前提条件就是父窗体需要有对iframe窗体的访问权限，因此此方案一般用于iframe载入的内容和父窗体是同域或者同父域的情形。<br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\"  >范例：</span><br><a target=\"_blank\" href=\"http://img458.ph.126.net/GHCWxNc1cdgEz8C_OfSXOg==/2550163288999478914.jpg\"  ><img title=\"禁止IFRAME记录历史 - genify - ajaxer\"  alt=\"禁止IFRAME记录历史 - genify - ajaxer\"  src=\"http://img458.ph.126.net/GHCWxNc1cdgEz8C_OfSXOg==/2550163288999478914.jpg\"  ></a><br><br><font style=\"font-weight: bold;\"  size=\"4\"  >方案二</font><br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\"  >原理：</span>先销毁已有iframe再创建一个新的，然后通过新的iframe载入新的页面内容<br><span style=\"color: rgb(0, 0, 255); font-weight: bold;\"  >分析：</span>不存在跨域问题，但是会有iframe不断创建销毁的额外开销<br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\"  >范例：</span><br><a target=\"_blank\" href=\"http://img58.ph.126.net/-u2HwLoBBE5ECBGD8Du95w==/1830150298574140747.jpg\"  ><img title=\"禁止IFRAME记录历史 - genify - ajaxer\"  alt=\"禁止IFRAME记录历史 - genify - ajaxer\"  src=\"http://img58.ph.126.net/-u2HwLoBBE5ECBGD8Du95w==/1830150298574140747.jpg\"  ></a>",
        "contentPlainText": "NTS框架中采用了新的方式记录浏览器的操作历史，因此在某些带IFRAME载入内容的项目中不希望这个IFRAME的变化影响到整个系统的操作历史，下面给出两种禁止IFRAME记录操作历史的解决方案，各有利弊视具体情况选取。方案一原理：利用location的replace方法载入新页面，关于replace方法的描述： When a document is replaced, it is also removed from the history object. Moreover, the user interface navigation methods, such as the Back and Forward buttons, will no longer access the URL. 分析：此方案有个前提条件就是父窗体需要有对iframe窗体的访问权限，因此此方案一般用于iframe载入的内容和父窗体是同域或者同父域的情形。范例：方案二原理：先销毁已有iframe再创建一个新的，然后通过新的iframe载入新的页面内容分析：不存在跨域问题，但是会有iframe不断创建销毁的额外开销范例：",
