        "content": "虽然说同样的一个效果不同的人可能会采用不同的页面实现，但是从拿到页面的程序员来说不同的实现可能会影响到具体实现的逻辑。下面我们取一个TAB效果来分析各种实现方式对脚本实现的影响。<br><a href=\"http://img237.ph.126.net/LeFZ5mJJQctF-lDWf5CImw==/1760907454303230415.jpg\" target=\"_blank\"><img title=\"优化CSS/XHTML的编写让JAVAS&lt;wbr&gt;CRIPT更易处理 - genify - ajaxer\" alt=\"优化CSS/XHTML的编写让JAVAS&lt;wbr&gt;CRIPT更易处理 - genify - ajaxer\" src=\"http://img237.ph.126.net/LeFZ5mJJQctF-lDWf5CImw==/1760907454303230415.jpg\"></a><br><font style=\"font-weight: bold;\" size=\"4\">方案一</font><br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">原理：</span>使用不同的选中样式标识，选中时添加相应的选中样式<br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">分析：</span>这种方式CSS开放给了程序若干个接口【理论上有多少种选中样式就需要提供多少个CSS接口】，如范例中的select-0、select-1、select-2等，因此从程序实现的角度来看必须增加逻辑去处理当前选中的TAB项需要增加的样式，同时也必须处理当前项不被选中时需要去除的选中样式，所以会增加额外的逻辑来处理这些差异。另外，如果有不同效果的TAB项增加时，程序还需要在切换中增加新的配置或处理逻辑。再有万一哪天统一了选中的效果呢？！因此这种方式一般不建议应用在实际项目中。<br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">范例：</span><br><a href=\"http://img241.ph.126.net/cLJO201sT97ZYXds0xlPVQ==/1396678834439623159.jpg\" target=\"_blank\"><img title=\"优化CSS/XHTML的编写让JAVAS&lt;wbr&gt;CRIPT更易处理 - genify - ajaxer\" alt=\"优化CSS/XHTML的编写让JAVAS&lt;wbr&gt;CRIPT更易处理 - genify - ajaxer\" src=\"http://img241.ph.126.net/cLJO201sT97ZYXds0xlPVQ==/1396678834439623159.jpg\"></a><br><font size=\"4\"><span style=\"font-weight: bold;\">方案二</span></font><br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">原理：</span>用ID标识TAB项，增加统一的选中样式标识选中项，样式中通过TAB ID和选中样式区分不同选中效果<br><span style=\"color: rgb(0, 0, 255); font-weight: bold;\">分析：</span>这种方式较第一种方式的一个改进就是CSS开放给程序统一的接口来处理选中效果，如范例中的select样式，程序实现时无需考虑其他因素只需要在选中项时增加选中样式，非选中时去除选中样式。但是因为这种方式使用了ID，因此如果项目中页面和程序是并行开发时，如果程序预先在逻辑种使用其中的ID，当拿到实际页面实现时可能会产生冲突。可能冲突的几率不是很大，因此这种方式看项目具体情况应用即可。<br><span style=\"color: rgb(0, 0, 255); font-weight: bold;\">范例：</span><br><a href=\"http://img.ph.126.net/gBtXCnl6pAx2ukr9t7UgIw==/3284531503237068322.jpg\" target=\"_blank\"><img title=\"优化CSS/XHTML的编写让JAVAS&lt;wbr&gt;CRIPT更易处理 - genify - ajaxer\" alt=\"优化CSS/XHTML的编写让JAVAS&lt;wbr&gt;CRIPT更易处理 - genify - ajaxer\" src=\"http://img.ph.126.net/gBtXCnl6pAx2ukr9t7UgIw==/3284531503237068322.jpg\"></a><br><font size=\"4\"><span style=\"font-weight: bold;\">方案三</span></font><br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">原理：</span>既然增加选中样式会有一定的限制，那就采用删除样式来标识当前选中项，因此这种方案预先会设置各个TAB项的选中效果，然后增加一个统一非选中效果的样式，当选中TAB项时把这个非选中效果的样式去掉即可。<br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">分析：</span>这种方式可以很好的解决上面两个方案的限制，需要程序实现时注意的是这里的选中效果是删除样式而不是增加样式，与上面的处理方式刚好相反。因此实际项目中我们建议用这种方式来实现TAB切换的效果。<br><span style=\"color: rgb(0, 0, 255);\">范例：</span><br><a href=\"http://img.ph.126.net/Co8SVNGFPQgaz7NcnmrB2g==/3231614207615463242.jpg\" target=\"_blank\"><img title=\"优化CSS/XHTML的编写让JAVAS&lt;wbr&gt;CRIPT更易处理 - genify - ajaxer\" alt=\"优化CSS/XHTML的编写让JAVAS&lt;wbr&gt;CRIPT更易处理 - genify - ajaxer\" src=\"http://img.ph.126.net/Co8SVNGFPQgaz7NcnmrB2g==/3231614207615463242.jpg\"></a><br>",
