        "content": "阿里D2论坛上来自口碑的嘉宾提到了一个image sprite的概念，当时感觉可能是css sprite，回来后看了一下口碑网的那个logo的实现方式，发现其实他用的不是css的背景而是img标签，因为前面做过图片的裁剪工具所以我觉得如果用img标签实现sprite的话可能还有另外一种实现方式，在此我大致讲一下这两种方式的实现原理和范例。<br>我们先取一张范例的整合图片<br><a href=\"http://img96.ph.126.net/ty1ia8btgoS8TOb_wlC6iA==/2047448980594893093.jpg\" target=\"_blank\"><img title=\"IMAGE SPRITE - genify - ajaxer\" alt=\"IMAGE SPRITE - genify - ajaxer\" src=\"http://img96.ph.126.net/ty1ia8btgoS8TOb_wlC6iA==/2047448980594893093.jpg\"></a><br><font style=\"font-weight: bold;\" size=\"4\">方案一</font><br><span style=\"color: rgb(0, 0, 255); font-weight: bold;\">原理：</span><b>用一个固定大小的div做窗口，里面的img标签绝对定位，然后设置img标签的位置，使需要看的那个图片刚好在div窗口初显示出来。也就是口碑的那个logo的实现方式。</b><br><span style=\"color: rgb(0, 0, 255); font-weight: bold;\">范例：</span><br><a href=\"http://img458.ph.126.net/ZRL8EmWpNRSYV6OfVLqInw==/2555511313556967331.jpg\" target=\"_blank\"><img title=\"IMAGE SPRITE - genify - ajaxer\" alt=\"IMAGE SPRITE - genify - ajaxer\" src=\"http://img458.ph.126.net/ZRL8EmWpNRSYV6OfVLqInw==/2555511313556967331.jpg\"></a><br><font style=\"font-weight: bold;\" size=\"4\">方案二</font><br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">原理：</span><b>利用样式的裁剪(clip)功能，裁剪img的指定区域显示。</b><br><span style=\"font-weight: bold; color: rgb(0, 0, 255);\">范例：</span><br><a href=\"http://img617.ph.126.net/TQPKEyqrxAOU6o9J6B6E-g==/1903615267495558540.jpg\" target=\"_blank\"><img title=\"IMAGE SPRITE - genify - ajaxer\" alt=\"IMAGE SPRITE - genify - ajaxer\" src=\"http://img617.ph.126.net/TQPKEyqrxAOU6o9J6B6E-g==/1903615267495558540.jpg\"></a><br>方案一和方案二的实现效果如下图所示<br><a href=\"http://img115.ph.126.net/72GVZyHLaC1iCy6_uc2_gw==/2005790684041628055.jpg\" target=\"_blank\"><img title=\"IMAGE SPRITE - genify - ajaxer\" alt=\"IMAGE SPRITE - genify - ajaxer\" src=\"http://img115.ph.126.net/72GVZyHLaC1iCy6_uc2_gw==/2005790684041628055.jpg\"></a><br>最后参观一下口碑那个logo的实现<br><a href=\"http://img58.ph.126.net/brhrEYNsTH7u9RL7e4qKdQ==/1831557673457726086.jpg\" target=\"_blank\"><img title=\"IMAGE SPRITE - genify - ajaxer\" alt=\"IMAGE SPRITE - genify - ajaxer\" src=\"http://img58.ph.126.net/brhrEYNsTH7u9RL7e4qKdQ==/1831557673457726086.jpg\"></a><a href=\"http://img1.ph.126.net/SS56WHEuV57zNvkyqMdKdw==/3181511661761657680.jpg\" target=\"_blank\"><img title=\"IMAGE SPRITE - genify - ajaxer\" alt=\"IMAGE SPRITE - genify - ajaxer\" src=\"http://img1.ph.126.net/SS56WHEuV57zNvkyqMdKdw==/3181511661761657680.jpg\"></a><br>",
        "contentPlainText": "阿里D2论坛上来自口碑的嘉宾提到了一个image sprite的概念，当时感觉可能是css sprite，回来后看了一下口碑网的那个logo的实现方式，发现其实他用的不是css的背景而是img标签，因为前面做过图片的裁剪工具所以我觉得如果用img标签实现sprite的话可能还有另外一种实现方式，在此我大致讲一下这两种方式的实现原理和范例。我们先取一张范例的整合图片方案一原理：用一个固定大小的div做窗口，里面的img标签绝对定位，然后设置img标签的位置，使需要看的那个图片刚好在div窗口初显示出来。也就是口碑的那个logo的实现方式。范例：方案二原理：利用样式的裁剪(clip)功能，裁剪img的指定区域显示。范例：方案一和方案二的实现效果如下图所示最后参观一下口碑那个logo的实现",
