        "blogAbstract": "今天在浏览网页时看到这么一条评论<br><div style=\"margin-left: 40px;\">Do not load stylesheets in the footer. Firefox charges ahead and renders the page before all stylesheets are downloaded. Chrome, Safari, and IE do the opposite – rendering is blocked until all stylesheets arrive at the browser<br></div>这个可能跟我之前预想的不太一样，因此做了以下的一个测试：浏览器是否要等所有样式加载完后才开始渲染页面。<br><span style=\"font-weight: bold;\">测试代码：</span><br>",
