        "content": "今天在浏览网页时看到这么一条评论<br><div style=\"margin-left: 40px;\">Do not load stylesheets in the footer. Firefox charges ahead and renders the page before all stylesheets are downloaded. Chrome, Safari, and IE do the opposite – rendering is blocked until all stylesheets arrive at the browser<br></div>这个可能跟我之前预想的不太一样，因此做了以下的一个测试：浏览器是否要等所有样式加载完后才开始渲染页面。<br><span style=\"font-weight: bold;\">测试代码：</span><br><div style=\"margin-left: 40px;\"><a href=\"http://img245.ph.126.net/JCqYfEkWWFOZ9RFEC4q1zw==/2111343800307977185.jpg\" target=\"_blank\"><img title=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" alt=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" src=\"http://img245.ph.126.net/JCqYfEkWWFOZ9RFEC4q1zw==/2111343800307977185.jpg\"></a><br></div><span style=\"font-weight: bold;\">IE下表现：</span><br><div style=\"margin-left: 40px;\">html加载完后碰到样式加载之前页面已经开始渲染了<br></div><div style=\"margin-left: 40px;\"><a href=\"http://img233.ph.126.net/SUZ5wFMuc-3Uun94kfI3zw==/1364872162071208809.jpg\" target=\"_blank\"><img title=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" alt=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" style=\"width: 352px; height: 149px;\" src=\"http://img233.ph.126.net/SUZ5wFMuc-3Uun94kfI3zw==/1364872162071208809.jpg\"></a><br>开始加载样式后页面又处于白屏状态<br><a href=\"http://img233.ph.126.net/oay-QW0ci3gned-MyN7LXw==/1364872162071208817.jpg\" target=\"_blank\"><img title=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" alt=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" style=\"width: 346px; height: 161px;\" src=\"http://img233.ph.126.net/oay-QW0ci3gned-MyN7LXw==/1364872162071208817.jpg\"></a><br>样式加载完后呈现页面<br><a href=\"http://img233.ph.126.net/M1fEecQKSiMTpr4n18QBRg==/1364872162071208821.jpg\" target=\"_blank\"><img title=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" alt=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" style=\"width: 342px; height: 149px;\" src=\"http://img233.ph.126.net/M1fEecQKSiMTpr4n18QBRg==/1364872162071208821.jpg\"></a><br></div><span style=\"font-weight: bold;\">FF/SF/OP下表现：</span><br><div style=\"margin-left: 40px;\">同IE浏览器，html加载完后碰到样式加载之前页面已经开始渲染了<br><a href=\"http://img624.ph.126.net/vvQZ10l_Udtel09S4R5hBA==/1712493758309002285.jpg\" target=\"_blank\"><img title=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" alt=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" style=\"width: 336px; height: 156px;\" src=\"http://img624.ph.126.net/vvQZ10l_Udtel09S4R5hBA==/1712493758309002285.jpg\"></a><br>开始加载样式时页面不会出现白屏<br><a href=\"http://img624.ph.126.net/hka-aQipEfKHfagte7LP-Q==/1712493758309002293.jpg\" target=\"_blank\"><img title=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" alt=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" style=\"width: 339px; height: 164px;\" src=\"http://img624.ph.126.net/hka-aQipEfKHfagte7LP-Q==/1712493758309002293.jpg\"></a><br>样式加载完后呈现页面<br><a href=\"http://img624.ph.126.net/ZL08GBqKTGq3i3V17x7L2g==/1712493758309002297.jpg\" target=\"_blank\"><img title=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" alt=\"外联样式置底在各浏览器下表现 - genify - ajaxer\" style=\"width: 333px; height: 161px;\" src=\"http://img624.ph.126.net/ZL08GBqKTGq3i3V17x7L2g==/1712493758309002297.jpg\"></a><br></div><span style=\"font-weight: bold;\">总结：</span><br><div style=\"margin-left: 40px;\">浏览器不会等所有样式加载完再来渲染页面，但是样式置底确实存在很多问题，包括性能上（关于这方面以有很多资料不详述），另外就是对体验上，特别是IE下会存在闪屏的情况，因此结论还是一致的，不管怎么样建议将样式放在head里。<br></div>",
        "contentPlainText": "今天在浏览网页时看到这么一条评论Do not load stylesheets in the footer. Firefox charges ahead and renders the page before all stylesheets are downloaded. Chrome, Safari, and IE do the opposite – rendering is blocked until all stylesheets arrive at the browser这个可能跟我之前预想的不太一样，因此做了以下的一个测试：浏览器是否要等所有样式加载完后才开始渲染页面。测试代码：IE下表现：html加载完后碰到样式加载之前页面已经开始渲染了开始加载样式后页面又处于白屏状态样式加载完后呈现页面FF/SF/OP下表现：同IE浏览器，html加载完后碰到样式加载之前页面已经开始渲染了开始加载样式时页面不会出现白屏样式加载完后呈现页面总结：浏览器不会等所有样式加载完再来渲染页面，但是样式置底确实存在很多问题，包括性能上（关于这方面以有很多资料不详述），另外就是对体验上，特别是IE下会存在闪屏的情况，因此结论还是一致的，不管怎么样建议将样式放在head里。",
